(24, 'Realizowane projekty ', '<p>On a recent Yii-based project, managing one of the Models required a whole slew of checkboxes to indicate that yes, the quality does apply, or no, it does not. In this case, the value being stored in the database for each attribute was a single letter: Y/N. However Yii, when showing the form to update an item, needs the checkbox value to be a Boolean, in order to properly pre-check the box. Changing the database wasn&rsquo;t an option in this case, so I had to figure out a good conversion process. In this post, I&rsquo;ll tell you exactly how I solved this issue.As I said, for the item in question, the database table had multiple columns, each of which only stored either&nbsp;Y&nbsp;or&nbsp;N. As an example, think of a users table with multiple opt-in options: newsletters, offers, etc. When the user creates and updates their account, presenting these as checkboxes is appropriate. But for the administrator, it&rsquo;d probably be best to view user preferences by just seeing Y/N for each option (although the code I&rsquo;m going to present wouldn&rsquo;t be significantly different if you stored 1/0).</p>\r\n<p>The&nbsp;protected/views/modelName/_form.php&nbsp;file defines the form that&rsquo;s used to both create and update an individual record. In it, checkboxes are created using:</p>', 1, 1, 1, 7, 2, NULL, 1, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2012-11-13 17:43:53', '0000-00-00 00:00:00'),
(25, 'Zrealizowane projekty ', '<p>Windows is reinvented with an all-new touch interface, Windows Store, and dev platform that lets you sell apps across the globe.</p>\r\n<p>To jest drugi akapit!</p>', 1, 1, 1, 7, 2, NULL, 2, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2012-11-13 17:54:29', '0000-00-00 00:00:00'),
