INSERT INTO `nws` (`NWS_ID`, `NWS_DATE`, `NWS_TITLE`, `NWS_CONTENT`) VALUES
(2, '2012-11-18 10:16:53', 'Zaproszenie na seminarium w ramach projektu "BIPnij dla przejrzystoci i transparentnoci NGO"', '<p>Stowarzyszenie Wzajemnej Pomocy "Bona Fides" zaprasza przedstawicieli organizacji pozarzdowych z regionu czstochowskiego, bytomskiego i sosnowieckiego na<strong> bezpatne seminaria</strong>, kt&oacute;re odbd si w dniach 20 listopada (Czstochowa), 21 listopada (Bytom), 22 listopada (Sosnowiec) 2012 roku&nbsp; w ramach realizacji projektu "BIPnij dla przejrzystoci i transparentnoci NGO".</p>\r\n<div class="itemFullText">\r\n<p>Podczas spotkania zostan zaprezentowane narzdzia i rozwizania wypracowane przez zesp&oacute; ekspert&oacute;w pochodzcych z r&oacute;nych organizacji i instytucji, kt&oacute;re zapewni organizacjom pozarzdowym prawidowe funkcjonowanie.</p>\r\n<p>Zaprezentujemy dokumenty dotyczce wymaga prawno-formalnych. Przedstawimy r&oacute;wnie projekt wzorcowej strony internetowej BIP (Biuletyn Informacji Publicznej), dostosowanej do potrzeb NGO. Organizacje bd mogy skorzysta <strong>bezpatnie</strong> z wypracowanych przez naszych ekspert&oacute;w rozwiza. <strong>Udzia w seminarium r&oacute;wnie jest cakowicie bezpatny</strong>.</p>\r\n<p>Kada organizacja moe zgosi<strong> 3 uczestnik&oacute;w</strong>.</p>\r\n<p><span style="color: #ff0000;"><strong>LICZBA MIEJSC OGRANICZONA!!!</strong></span></p>\r\n<p>Zgoszenia prosimy przesya na adres mailowy:<br /> <a href="mailto:katarzyna@bonafides.pl">katarzyna@bonafides.pl</a> <br /> lub <br /><a href="mailto:natalia@bonafides.pl">natalia@bonafides.pl</a></p>\r\n<p>&nbsp;</p>\r\n<p>Projekt &bdquo;BIPnij dla przejrzystoci i transparentnoci NGO&rdquo; realizowany jest w okresie kwiecie 2012 &ndash; listopad 2013 przez Stowarzyszenie Wspierania Organizacji Pozarzdowych MOST oraz Stowarzyszenie Wzajemnej Pomocy Bona Fides, a wsp&oacute;finansowany przez Uni Europejsk w ramach Europejskiego Funduszu Spoecznego.</p>\r\n</div>');

